import React from "react";

class Converter extends React.Component {
  state = {
    result: null,
    fromCurrency: "USD",
    toCurrency: "GBP",
    amount: 1,
    currencies: [],
};

  render() {
    return <div>I am converter</div>;
  }
}
export default Converter;
